import React from "react";

function Card(props) {
  return (
    <div className="max-w-sm p-2 " key={props.id}>
      <div className="text-2xl font-semibold text-gray-900">{props.name}</div>
      <div className="font-bold text-lg">{props.occupation}</div>
      <div className="text-blue-800">{props.email}</div>
      <div className="text-sm text-gray-600">{props.bio}</div>
    </div>
  );
}

export default Card;
